            "ವಿಯೆಟ್ನಾಮೀಸ್ ಕಾನೂನುಗಳ ಅಡಿಯಲ್ಲಿ, ಬಳಕೆದಾರರ ಮಾಹಿತಿಯನ್ನು ಹೆಸರುಗಳು, ಇಮೇಲ್ ವಿಳಾಸಗಳು, ಪಾಸ್‌ವರ್ಡ್‌ಗಳು ಮತ್ತು ಹುಟ್ಟಿದ ದಿನಾಂಕವನ್ನು \"ವೈಯಕ್ತಿಕ ಮಾಹಿತಿ\" ಎಂದು ವರ್ಗೀಕರಿಸಬಹುದು. \n ನಿರ್ದಿಷ್ಟವಾಗಿ, \n (a) ತೀರ್ಪು 72/2013 ಅಡಿಯಲ್ಲಿ, ವೈಯಕ್ತಿಕ ಮಾಹಿತಿಯನ್ನು ಹೀಗೆ ವ್ಯಾಖ್ಯಾನಿಸಲಾಗಿದೆ ಹೆಸರು, ವಯಸ್ಸು, ವಿಳಾಸ, ಜನರ ಗುರುತಿನ ಚೀಟಿ ಸಂಖ್ಯೆ, ದೂರವಾಣಿ ಸಂಖ್ಯೆ, ಇಮೇಲ್ ವಿಳಾಸ ಮತ್ತು ಕಾನೂನಿನ ಪ್ರಕಾರ ಇತರ ಮಾಹಿತಿ ಸೇರಿದಂತೆ ವ್ಯಕ್ತಿಯ ಗುರುತು ಮತ್ತು ವೈಯಕ್ತಿಕ ವಿವರಗಳನ್ನು ಗುರುತಿಸಲು ಲಗತ್ತಿಸಲಾದ ಮಾಹಿತಿ \n \n (b) ಸುತ್ತೋಲೆ 25 ರ ಅಡಿಯಲ್ಲಿ /2010, ವೈಯಕ್ತಿಕ ಮಾಹಿತಿ ಎಂದರೆ ಒಬ್ಬ ವ್ಯಕ್ತಿಯನ್ನು ನಿಖರವಾಗಿ ಗುರುತಿಸಲು ಸಾಕಾಗುವ ಮಾಹಿತಿ, ಇದರಲ್ಲಿ ಈ ಕೆಳಗಿನ ವಿವರಗಳಲ್ಲಿ ಒಂದನ್ನಾದರೂ ಒಳಗೊಂಡಿರುತ್ತದೆ: ಪೂರ್ಣ ಹೆಸರು, ಹುಟ್ಟಿದ ದಿನಾಂಕ, ಉದ್ಯೋಗ, ಶೀರ್ಷಿಕೆ, ಸಂಪರ್ಕ ವಿಳಾಸ, ಇಮೇಲ್ ವಿಳಾಸ, ದೂರವಾಣಿ ಸಂಖ್ಯೆ, ಗುರುತಿನ ಚೀಟಿ ಸಂಖ್ಯೆ ಮತ್ತು ಪಾಸ್‌ಪೋರ್ಟ್ ಸಂಖ್ಯೆ. ವೈಯಕ್ತಿಕ ಗೌಪ್ಯತೆಯ ಮಾಹಿತಿಯು ಆರೋಗ್ಯ ದಾಖಲೆ, ತೆರಿಗೆ ಪಾವತಿ ದಾಖಲೆ, ಸಾಮಾಜಿಕ ವಿಮಾ ಕಾರ್ಡ್ ಸಂಖ್ಯೆ, ಕ್ರೆಡಿಟ್ ಕಾರ್ಡ್ ಸಂಖ್ಯೆ ಮತ್ತು ಇತರ ವೈಯಕ್ತಿಕ ರಹಸ್ಯಗಳನ್ನು ಒಳಗೊಂಡಿದೆ. \n ವಿಯೆಟ್ನಾಂ ಸರ್ಕಾರಿ ಅಧಿಕಾರಿಗಳು ನಿರ್ವಹಿಸುವ ವೆಬ್‌ಸೈಟ್‌ಗಳ ವೈಯಕ್ತಿಕ ಮಾಹಿತಿ ಸಂಗ್ರಹಣೆ ಮತ್ತು ಬಳಕೆಗೆ ಸುತ್ತೋಲೆ 25 ಅನ್ವಯಿಸುತ್ತದೆ. ಸರ್ಕಾರೇತರ ಸಂಸ್ಥೆಗಳು ನಿರ್ವಹಿಸುವ ವೆಬ್‌ಸೈಟ್‌ಗಳಿಂದ ವೈಯಕ್ತಿಕ ಮಾಹಿತಿಯ ಸಂಗ್ರಹ ಮತ್ತು ಬಳಕೆಗೆ ಸುತ್ತೋಲೆ 25 ನೇರವಾಗಿ ಅನ್ವಯಿಸುವುದಿಲ್ಲ. ಆದಾಗ್ಯೂ, ಸುತ್ತೋಲೆ 25 ರ ನಿಬಂಧನೆಗಳನ್ನು ಸಾದೃಶ್ಯದ ಮೂಲಕ ಅನ್ವಯಿಸಬಹುದು. ಇದರ ಜೊತೆಯಲ್ಲಿ, ಸರ್ಕಾರೇತರ ಸಂಸ್ಥೆಯು ಸರ್ಕಾರಿ ಘಟಕಕ್ಕೆ ಅನ್ವಯಿಸುವಂತೆಯೇ ಅದೇ ಅಥವಾ ಹೆಚ್ಚು ಕಠಿಣ ಮಾನದಂಡಗಳಿಗೆ ಒಳಪಟ್ಟಿರುತ್ತದೆ."),
